    private static OncoTreeNode createOncoTreeNode(String uri, String code, String name, String mainType, String color, String parentCode, String revocations, String precursors) {
        OncoTreeNode newNode = new OncoTreeNode();
        newNode.setURI(uri);
        newNode.setCode(code);
        newNode.setName(name);
        newNode.setMainType(mainType);
        newNode.setColor(color);
        newNode.setParentCode(parentCode);
        newNode.setRevocations(revocations);
        newNode.setPrecursors(precursors);
        return newNode;
    }

