    public List<OncoTreeNode> getOncoTree(Version version) throws TopBraidException {
        initialize_tumor_types_if_necessary();
        String oncotree_api_identifier = version.getVersion();
        List<OncoTreeNode> oncoTree = versionToOncoTree.get(oncotree_api_identifier);
        if (oncoTree == null) {
            logger.error("called getOncoTree with version : " + oncotree_api_identifier);
            System.out.println("called getOncoTree with version : " + oncotree_api_identifier);
            throw new TopBraidException("Attempted to retrieve a non-existant version from TopBraid : " + oncotree_api_identifier);
        }
        return oncoTree;
    }

